import React from 'react';
import { BrowserRouter as Router, Route, Routes, Outlet } from 'react-router-dom';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import Protected from './component/Routs/ProtectedHome';
import './App.css'; // Import the CSS file for transitions

import Home from './pages/Home';
import Progress from './pages/Progress';
import Exeplore from './pages/Exeplore';
import Profile from './pages/Profile';
import Messeges from './pages/messeges';
import Register from './pages/Register';
import LoginPage from './pages/Login';

function App() {
  const theme = createTheme({
    palette: {
      primary: {
        main: '#FFFFFF',
      },
      secondary: {
        main: '#0000FF',
      },
    },
  });

  return (
    <ThemeProvider theme={theme}>
      <Router>
        <div className="App">
          <Routes>
            <Route path="/home" element={<Protected><Outlet /></Protected>} />
            <Route path="/prof" element={<Protected><Outlet /></Protected>} />
            <Route path="/prog" element={<Protected><Outlet /></Protected>} />
            <Route path="/exp" element={<Protected><Outlet /></Protected>} />
            <Route path="/messeges" element={<Protected><Outlet /></Protected >} />
            <Route path="/register" element={<Register />} />
            <Route path="/login" element={<LoginPage />} />
          </Routes>
        </div>
      </Router>
    </ThemeProvider>
  );
}

export default App;
